def count_subsequences_ending_at_one(sequence):
    n = len(sequence)
    dp = {}

    def game(cPose, cGCD):
        if cPose == n:
            return 1 if cGCD == 1 else 0
        if cGCD == 1:
            return 2 ** (n - cPose)
        if (cPose, cGCD) in dp:
            return dp[cPose, cGCD]
